deck_description:
Deck is fairly simple, its a combo deck which usually ends up Turn 1 with a bunch of Negates, such as Apollousa, Halq+Scythe Lock (Baronne de Fleur), and maybe a Number 38 Tachyon Dragon/Galaxy Lord or Hot Red Dragon Abyss Archfiend (Optional Hand: E-Tele + Melody of Awakening Dragon)

&nbsp;

Combo can be seen here: https://www.youtube.com/watch?v=e84V95htWpI&amp;t=711s

After I've been thinking about some personal sh#t in my life for the past few days, I finally got off my @$$ and made some deck profiles for Kazuki Takahashi as tribute to his legacy. At 60 years old, he was taken from us too soon, and the Yu-Gi-Oh community did not deserve this tragedy. My Takahashi-themed decks will be of archetypes who were either revealed during the era they were based on, or whose key cards were revealed during that era.

&nbsp;

This is my SEVENS-era deck and my final deck for the Kazuki Takahashi series. This is a pure P.U.N.K. deck I made with their newest cards--P.U.N.K. JAM Dragon Drive and P.U.N.K. JAM Extreme Session! This deck runs 9 hand traps, so it can go second and do pretty well. It can also go first and summon Hot Red Dragon Archfiend King Calamity on their turn.

