&nbsp;

This is my ARC-V themed deck, Burning Abyss. Unfortunately, I suck harder than moms in early 2000s' hentai at playing Pendulums, so I went with Burning Abyss instead. Generally, the deck does well first or second, but this specific build is better off going on the offensive.  In addition to the standard 6 hand traps, it runs 3 Forbidden Droplets and 2 Lightning Storm and 1 Harpie's Feather Duster.

After I've been thinking about some personal sh#t in my life for the past few days, I finally got off my @$$ and made some deck profiles for Kazuki Takahashi as tribute to his legacy. At 60 years old, he was taken from us too soon, and the Yu-Gi-Oh community did not deserve this tragedy. My Takahashi-themed decks will be of archetypes who were either revealed during the era they were based on, or whose key cards were revealed during that era.

&nbsp;

My ZEXAL-themed deck is Trains, with Clockwork Night and Foolish Burial Goods as tech choices. For the most part, I send Clockwork Night to the graveyard (either with Revolving Switchyard or Goods) to get more search power. Also, combo'd with some other cards, you can search Flying Pegasus Railway Stampede and get a total of 3 Level 10 Machines on the field, for 2 Rank 10 Xyz monsters.

&nbsp;

Even with the extra searching and summoning power that Clockwork Night and FBG provide, you want to go second. Trains are still very much a go-second deck.

&nbsp;

&nbsp;

