&nbsp;

This is my 5Ds-era deck, Nordic (with an Adventurer Token engine). I didn't have many options for 5Ds-era archetypes to choose, either because those archetypes are terrible, or they are too complicated for me to play. So I went with Nordics, which are admittedly still very lacking as an archetype. The reason for the name is obvious. Because of the Adventurer Token engine and Nordics' whole "defend the castle" playstyle, you wanna go first at all times.

After I've been thinking about some personal sh#t in my life for the past few days, I finally got off my @$$ and made some deck profiles for Kazuki Takahashi as tribute to his legacy. At 60 years old, he was taken from us too soon, and the Yu-Gi-Oh community did not deserve this tragedy. My Takahashi-themed decks will be of archetypes who were either revealed during the era they were based on, or whose key cards were revealed during that era.

&nbsp;

This is my GX-themed deck: Lost World Dinos. Babycerasaurus was a card used by Tyranno Hassleberry, one of my favorite characters from Yu-Gi-Oh GX. Ultimate Conductor Tyranno is basically a fusion of all of his "Tyranno" monsters, and Lost World is more or less a retrain of Jurassic World, which he used. Gameplay wise, this deck can go first or second, but I prefer to go second. It also has a Super Poly and Doodle Beast engine in the side deck.

&nbsp;

As for the name of this deck, "Takahashodon", it essentially translates to "Takahashi's Tooth" or "Takahashi's Teeth", as if it were referring to a prehistoric animal. It comes from the Greek root word "odon", which means "tooth/teeth." A lot of extinct animals have names with this root: <em>Dimetrodon, Iguanodon, Heterodontosaurus, Carcharodontosaurus, Smilodon, Megalodon, Liopleurodon, Dimorphodon</em>, and so on.

After I've been thinking about some personal sh#t in my life for the past few days, I finally got off my @$$ and made some deck profiles for Kazuki Takahashi as tribute to his legacy. At 60 years old, he was taken from us too soon, and the Yu-Gi-Oh community did not deserve this tragedy. My Takahashi-themed decks will be of archetypes who were either revealed during the era they were based on, or whose key cards were revealed during that era. The first Takahashi-themed deck is Amazoness, which was originally played by Mai Valentine in Yu-Gi-Oh: Duel Monsters.

&nbsp;

Amazoness can do well going first, but going second for this deck in particular is heavily preferred, particularly due to the high amount of hand traps.

&nbsp;

As for the name of this deck, it's partially due to the fact that Takahashi drew the Amazoness monsters in the Yu-Gi-Oh manga, and they were originally really muscular. And as a proud muscle fetishi--*Ahem*...wheyfu enthusiast, I've always liked this archetype. Also, I saw Tania in Yu-Gi-Oh! GX, and them biceps...Dayum!
